const Recipes = () => {
    return(
        <ul>
            {recipesList.map((recipe, index) => {
                <li index={index}>{recipe.name + '' + recipe.quantity}</li>
            })}
        </ul>
    )
}

const recipesList = [recipe1, recipe2];

const recipe1 = {
    ingredients: [
        {
            name: 'cheese',
            quantity: 2
        },
        {
            name:'bread',
            quantity: 3
        }
    ]
}
const recipe2 = {
    ingredients: [
        {
            name: 'butter',
            quantity: 1
        },
        {
            name:'salt',
            quantity: 1
        }
    ]
}

export default Recipes;
